import { CssBaseline, ThemeProvider } from "@material-ui/core";
import React from "react";
import { render } from "react-dom";
import App from "./App";
import theme from "./theme";

const root = document.getElementById("root");
render(
  <React.StrictMode>
    <ThemeProvider theme={theme}>
      <CssBaseline/>
      <App />
    </ThemeProvider>
  </React.StrictMode>
  ,
  root
 );
